import {useCallback, useState} from "react";
import axios from "axios";

const Search = () => {
  const [value, setValue] = useState();

  const onChangeValue = useCallback((e) => {
    setValue(e.target.value);
  }, []);

  return (
    <div>
      <form>
        <input
          type="text"
          onChange={onChangeValue}
        />
        <button
          type="submit"
        >
          검색
        </button>
      </form>
    </div>
  );
};

export default Search;
